        <p class="about-brand-title">درباره شرکت باکنشت</p>
        <p class="about-brand-text">
        
  باکنشت  ، به طور رسمی Bauknecht Hausgeräte GmbH ، یکی از برجسته ترین تولید کنندگان لوازم خانگی در آلمان بود و از سال 1989 مارک شرکت Whirlpool است. دفتر مرکزی این شرکت قبلاً در Schorndorf در بادن-وورتمبرگ بود تا سال 2006 که دوباره به اشتوتگارت منتقل شد. Whirlpool سه کارخانه خود را در Calw (یخچال و فریزر) ، Neunkirchen (ماشین ظرفشویی) و Schorndorf (واشر و خشک کن) تعطیل کرده است. از سال 2012 کلیه محصولات با مارک Bauknecht در خارج از آلمان تولید می شوند.
  تاریخ
  این شرکت در سال 1919 توسط گوتلوب باکنشت به عنوان یک کارگاه برق در Neckartenzlingen تاسیس شد. او برای اولین بار برای موتور الکتریکی جهانی خود که "Landfreund" ساخته شد ، به رسمیت شناخته شد.
  
  اما تنها در آلمان پس از جنگ بود که این شرکت گام بزرگ خود را در تولید لوازم الکتریکی برداشت ، از سال 1948 با لوازم آشپزخانه "Allfix" شروع کرد. در سال 1951 ، اولین یخچال باکنشت ، در سال 1958 اولین ماشین لباسشویی و در سال 1964 اولین ماشین ظرفشویی تولید شد.
  
  در 9 سپتامبر 1976 ، بنیانگذار شرکت در سن 84 سالگی درگذشت و مدیریت را پسرانش بر عهده گرفت. به دلیل برخی از سرمایه های خارجی زیان ده و خارج شدن بانکها از سایر تعهدات مالی ، در 13 مه 1982 توافق نامه ای درخواست شد. در 29 اکتبر 1982 ، دادگاه منطقه اشتوتگارت زمینه ورشکستگی دارایی های باوکنخت را فراهم کرد. در 2 نوامبر 1982 ، فولکر گروب ، مدیر تصفیه ، قرارداد تصرف با بخش آلمانی فیلیپس (Deutsche Philips Industrie AG) را امضا کرد.
  
  از سال 1989 ، Bauknecht Hausgeräte GmbH عضو گروه آمریکایی Whirlpool Corporation بوده است. تأسیسات نئون کیرچن در زارلند از سال 1971 ماشین ظرفشویی تولید و ساخته است. در سال 1996 ، مرکز فناوری اروپا برای ماشین های ظرفشویی نیز در نونکیرچن مستقر شد. مرکز توسعه جهانی ماشین لباسشویی و خشک کن ، که در آن واشرهای زیادی برای بازار ایالات متحده تولید می شود ، در Schorndorf مستقر شد.
  
  در آغاز سال 2012 ، تامین کننده خودرو ZF Friedrichshafen کارخانه خود را در نئون کیرچن با 240 باکنشتر از 280 کارمند محلی تحویل گرفت تا ظرفیت تولید خود را در قطعات انتقال گسترش دهد. پس از آموزش مجدد ، کارکنانی که قبلا ماشین ظرفشویی نصب می کردند ، جعبه دنده وسایل نقلیه را تولید می کردند. در پایان سال 2012 سایت تولید در Schorndorf نیز بسته شد
    </p>
